import styled from "styled-components";

const Note = styled.div`
  text-decoration: none;
  margin: 20px 20px 20px 20px;
  color: #000;
  background: white;
  height: 20em;
  width: 20em;
  padding: 1em;
`;

const Ticket = () => {
  return (
    <div className="box">
      <Note>Els≈ë feladat</Note>
    </div>
  );
};

export default Ticket;
